components:
- components: []
  layout_properties: {slot: default}
  name: content_panel
  properties: {}
  type: ColumnPanel
- components:
  - event_bindings: {click: link_1_click}
    layout_properties: {}
    name: link_1
    properties: {text: DB Coffee Logs}
    type: Link
  - data_bindings: []
    event_bindings: {click: link_DB_users_click}
    layout_properties: {}
    name: link_DB_users
    properties: {icon: 'fa:database', text: DB Users, visible: true}
    type: Link
  - event_bindings: {click: button_csv_click}
    layout_properties: {}
    name: button_csv
    properties: {bold: false, text: Statistics}
    type: Link
  - components: []
    event_bindings: {click: generate_pdf_button_click}
    layout_properties: {}
    name: button_pdf
    properties: {bold: false, icon: 'fa:file-pdf-o', text: PDF}
    type: Link
  - event_bindings: {click: sign_in_button}
    layout_properties: {}
    name: sign_in
    properties: {bold: false, icon: 'fa:user', text: Sign In}
    type: Link
  layout_properties: {slot: nav-right}
  name: navbar_links
  properties: {}
  type: FlowPanel
- event_bindings: {click: title_click}
  layout_properties: {slot: title}
  name: title
  properties: {text: 'Web application for interactive coffee management '}
  type: Link
container:
  properties: {html: '@theme:standard-page.html'}
  type: HtmlTemplate
is_package: true
